def merge_strings(strings):
    max_overlap = -1
    merge_pair = (0, 0)

    for i in range(len(strings)):
        for j in range(len(strings)):
            if i != j:
                for k in range(len(strings[j]), 0, -1):
                    if strings[i].endswith(strings[j][:k]) and k > max_overlap:
                        max_overlap = k
                        merge_pair = (i, j)

    i, j = merge_pair
    strings[i] += strings[j][max_overlap:]
    strings[j] = ""  

    return strings

def find_shortest_superstring(strings):
    while len([s for s in strings if s != ""]) > 1:
        strings = merge_strings(strings)

    return [s for s in strings if s != ""][0]

